const rootEndpoint = "https://kaamelott.chaudie.re";

const headers = {
  "Content-Type": "application/json",
  Accept: "application/json"
};

class Quote {
  constructor(citation, personnage, saison, episode) {
    this.citation = citation;
    this.personnage = personnage;
    this.saison = saison;
    this.episode = episode;
  }
}

const _createCitation = quote => {
  return new Quote(
    quote.citation,
    quote.infos.personnage,
    quote.infos.saison,
    quote.infos.episode
  );
};

const _createCitations = citations => {
  let tabQuote = [];
  for (let i = 0; i < citations.length; i++) {
    tabQuote.push(`${citations[i].citation}`);
  }
  return tabQuote;
};

// retourne une quote au hasard
export const getRandomQuote = () =>
  fetch(`${rootEndpoint}/api/random`, { headers })
    .then(response => response.json())
    .then(jsonResponse => _createCitation(jsonResponse.citation))
    .catch(error => {
      console.error(error);
    });

// retourne une quote d'1 perso particulier
export const getRandomQuote1Perso = perso =>
  fetch(`${rootEndpoint}/api/random/personnage/${perso}`, { headers })
    .then(response => response.json())
    .then(jsonResponse => _createCitation(jsonResponse.citation))
    .catch(error => {
      console.error(error);
      console.debug(perso);
    });

// retourne toutes les quotes d'1 perso particulier
export const getAllQuote1Perso = perso =>
  fetch(`${rootEndpoint}/api/all/personnage/${perso}`, { headers })
    .then(response => response.json())
    .then(jsonResponse => jsonResponse.citation)
    .then(quote => _createCitations(quote))
    .catch(error => {
      console.error(error);
      console.debug(perso);
    });

